#[test]
fn check_r4000allegrex_vfpu_instructions_branches() {
    const ENTRIES: &[TestEntry] = &[
        /* branches */
        TestEntry::new_r4000allegrex(
            0x49000002,
            "bvf         0, . + 4 + (0x2 << 2)",
            Opcode::r4000allegrex_bvf,
            "bvf",
            [Some("0"), Some(". + 4 + (0x2 << 2)"), None, None, None],
        ),
        TestEntry::new_r4000allegrex(
            0x49050002,
            "bvt         1, . + 4 + (0x2 << 2)",
            Opcode::r4000allegrex_bvt,
            "bvt",
            [Some("1"), Some(". + 4 + (0x2 << 2)"), None, None, None],
        ),
        TestEntry::new_r4000allegrex(
            0x490A0002,
            "bvfl        2, . + 4 + (0x2 << 2)",
            Opcode::r4000allegrex_bvfl,
            "bvfl",
            [Some("2"), Some(". + 4 + (0x2 << 2)"), None, None, None],
        ),
        TestEntry::new_r4000allegrex(
            0x490F0002,
            "bvtl        3, . + 4 + (0x2 << 2)",
            Opcode::r4000allegrex_bvtl,
            "bvtl",
            [Some("3"), Some(". + 4 + (0x2 << 2)"), None, None, None],
        ),
        TestEntry::new_r4000allegrex(
            0x49100002,
            "bvf         4, . + 4 + (0x2 << 2)",
            Opcode::r4000allegrex_bvf,
            "bvf",
            [Some("4"), Some(". + 4 + (0x2 << 2)"), None, None, None],
        ),
        TestEntry::new_r4000allegrex(
            0x49150002,
            "bvt         5, . + 4 + (0x2 << 2)",
            Opcode::r4000allegrex_bvt,
            "bvt",
            [Some("5"), Some(". + 4 + (0x2 << 2)"), None, None, None],
        ),
        TestEntry {
            instr: Instruction::new_r4000allegrex(
                0x49000002,
                Vram::new(0x80000000),
                InstructionFlags::default(),
            ),
            imm_override: Some("branches_end"),
            display_flags: DisplayFlags::default(),
            valid: true,
            expected: "bvf         0, branches_end",
            expected_opcode: Opcode::r4000allegrex_bvf,
            opcode_str: "bvf",
            operands_str: [Some("0"), Some("branches_end"), None, None, None],
        },
    ];

    assert_eq!(check_test_entries(ENTRIES, true), (0, 0));
}

